import React from 'react'

export default function reducer(state,action) {
    switch(action.type){
    //    case "ADDTOWATCHLATER":
    //     return {...state,watchlater:state.watchlater.concat("hellos")} 
        case "ADDTOWATCHLATER":
        return {...state,test:"jhkhkhkh"} ;
        default: return state
    }
}
